import{_ as c}from"./chunks/index.VAya1KE4.js";import{c as a,o as e,G as o,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":379,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":379,"name":"安比","summary":"安比·德玛拉","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/01/76099754/eb28176da1bfd52ecd00c96c6641fe0d_863124956510266341.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/5b0e32552b07c947bb65be33ebeeaeb2_1703246464973755405.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/f52acbc7bc625ba62aacdfcbcb7f64cc_5255041409433299502.png"},"attrs":[["稀有度","A"],["属性","电"],["特性","击破"],["阵营","狡兔屋"]],"destiny":[["LEVEL1快充模式","[普通攻击]第四段斩击命中敌人时，安比的能量获得效率提升12%，持续30秒。「快充一分钟，战斗半小时！」为武器加装拓展功能模块的专家是这么保证的——使用效果也确实符合他的宣言。"],["LEVEL2精准放电","[普通攻击：落雷]命中处于失衡状态下的敌人时，招式造成的伤害提升30%；[强化特殊技]命中未处于失衡状态下的敌人时，招式造成的失衡值提升10%。「触电了，就会晕倒。」少女淡淡的望着面前轰然昏倒的敌人，补了一句：「电影里都是这么演的。」"],["LEVEL3训练有素","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2奔跑、挥刀、动若雷霆。少女不是探索空洞的生手，而是精于此道的专家。"],["LEVEL4电荷传导","发动[连携技]或[终结技]时，为后场电属性角色回复3点能量；安比每拥有12%能量获得效率，回复量额外提升2点，最多额外提升6点。单打独斗不是长久之计，老练的盗洞客还会在战斗中适时为队友创造机会。"],["LEVEL5街头经验","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2狡兔屋的工作不仅能提升心理素质，还能（被迫）提升身体素质。"],["LEVEL6充能电场","发动[强化特殊技]时，安比获得8层充能（上限8层）；[普通攻击]或[冲刺攻击]命中敌人时，消耗1层充能，使当前招式造成的伤害提升45%。闪烁的电光在少女的指尖跳跃。少女抬起头，眼里盛着超出外貌年龄的坚毅。或许终有一日，她将成为掌控这须臾电光的人。"]],"skill":[{"title":"普通攻击：伏特速攻","desc":"点按发动：向前方进行至多四段的斩击，前三段造成物理伤害，第四段造成电属性伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/31/5647439/2025cdc615bb1819dd97de612556927b_3474128111701866978.gif"},{"title":"普通攻击：落雷","desc":"发动[普通攻击]第三段后，长按或停顿后点按发动：向前方进行下落打击，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82232455/535dab3bfe7a3d9cccb6befffacdcee1_472302793356628138.gif"},{"title":"闪避：滑步","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/28/82232455/91c5ee36a8f1964b72a8b62f9b36a2c9_7238469679348225477.gif"},{"title":"闪避反击：迅雷","desc":"触发[极限闪避]后，点按发动：对前方敌人发动斩击，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82232455/891aa6efac09eb3233271d0f1758fcb3_7002236384601511772.gif"},{"title":"冲刺攻击：电弧斩","desc":"闪避时，点按发动：向周身敌人进行斩击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/28/82232455/6beca21465efcc03450b1c5862cbe239_1864059154110364117.gif"},{"title":"招架支援：电光一闪","desc":"当前操作中的角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82232455/94800ecc9e4b5c6be23e236b67f4e956_4221590204345903971.gif"},{"title":"快速支援：降雷前场","desc":"前场角色被击飞时，点按发动：对前方敌人发动斩击，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82232455/47fd05db39d86a765d6392279b11585b_4161300929197479496.gif"},{"title":"支援突击：回旋闪电","desc":"发动[招架支援]后，点按发动：对前方敌人发动回旋斩击，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/82232455/6364965d8f004e1972d70c5f507ae055_2973900940232341666.gif"},{"title":"特殊技：电光挥击","desc":"点按发动：向前方进行上挑斩击，造成电属性伤害；若衔接在[普通攻击]第三段或[普通攻击：落雷]之后，则能够以更快的速度发动；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/01/294465423/da76facb91c7115f4c84200756f60ae2_2201620180811185444.gif"},{"title":"强化特殊技：苍雷斩","desc":"能量足够时，点按发动：向前方进行强力上挑斩击，造成大量电属性伤害；若衔接在[普通攻击]第三段或[普通攻击：落雷]之后，则能够以更快的速度发动；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/28/82232455/69b83e95c2d1718a925bf167aa0a064a_8402460079051834991.gif"},{"title":"终结技：过载引擎","desc":"喧响等级达到[极]时，点按发动：对前方小范围敌人发动强力上挑斩击，并追加下落攻击，造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/28/82232455/4b7ca3ed6e983144b5c12d086a1d1d46_2007927208308753185.gif"},{"title":"连携技：电磁引擎","desc":"触发[连携技]时，选择对应角色发动：对前方小范围敌人发动强力上挑斩击，造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/28/82232455/1c06b4fd15e8c601902c4df772c4dcd2_2851030080775442092.gif"},{"title":"核心技","desc":"核心被动：波动电压安比在[普通攻击]第三段后发动[普通攻击：落雷]、[特殊技]或[强化特殊技]时，招式造成的失衡值提升32%。（此处数据为初始数据）额外能力：并联电路队伍中存在与自身属性或阵营相同的角色时触发：安比发动[闪避反击]命中敌人时，额外回复7.2点能量，5秒内最多触发一次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/28/82232455/245543be71ecd3d486103096dc3da8a1_6062667524150339577.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/379.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/379.md"},_=Object.assign(d,{setup(i){return(p,n)=>(e(),a("div",null,[o(t(c))]))}});export{l as __pageData,_ as default};
